import React, { Component } from "react";

class CARDS extends Component {
  render() {
      const {productos}=this.props;
  
    return (
      <div className="center flexC">
      {productos.map((el)=>
       <div className="card">
     <img alt={el.name} src={el.img} className='card__img'></img>
       </div>
      )}
       

      </div>
    );
  }
}
export default CARDS;
